import React, {Fragment} from 'react';
import ViewCapacity from '../components/ViewCapacity';




function Record() {
    return (
        <Fragment>
            <h1 style={{ textAlign: 'center', marginBottom: '5px' }}>Capacity</h1>
            <input type="text" placeholder="Search..." style={{width: "100%", padding: "12px", margin: "8px 0", display: "inline-block", border: "1px solid #ccc", borderRadius: "4px", boxSizing: "border-box"}}></input>
            <br/>
            <ViewCapacity />  
        </Fragment>
    );
}

export default Record;
